import NavigationLink from './NavigationLink';
import appConfig from '../app.config';


let SubHeader = () => {
	return (
		<div className="tabs">
			<NavigationLink
				linkList={appConfig.subNavLink}
				type="li"
			/>
		</div>
	)
}


export default SubHeader;
